    const buyingList = Object.entries(item["recipe"]["buy"]);
    const craftingList = Object.entries(item["recipe"]["craft"]);
    const priceSell = item["price_sell"];
    if(craftingList == undefined)return -1;
    let ppc = getPPC(buyingList);
    let quantity = 0;
    let totalCost = buySum(buyingList); // for items which are bought
    console.log(totalCost)
    for (const key in craftingList) {
        if (craftingList[1][key]["id"] === item["id"]) {
            quantity = craftingList[1][key]["craft"];
            totalCost += craftingList[1][key];
        }
    }
    const gain = priceSell * quantity * MARKET_PERCENTAGE;
    return gain - totalCost;
}

function computeRoi(investment, profit) {
    return parseInt((profit / investment) * 100);
}

function formatNumber(num) {
    let string = "";
    if (num > 1000000000) {
        string = (num / 1000000000).toFixed(2) + "b";
    } else if (num > 1000000) {
        string = (num / 1000000).toFixed(2) + "m";
    } else if (num > 1000) {
        string = (num / 1000).toFixed(2) + "k";
    }
    return string;
}


